import React from 'react';
import './Projects.css'; // Ensure you have this file for styling

const projectsData = [
  {
    title: "Project One",
    description: "Description of project one.",
    link: "http://example.com/project-one",
    image: "https://i.pinimg.com/originals/bb/34/01/bb34017e0cd6eeaff3e785b60a8ff59f.gif",
  },
  {
    title: "Project Two",
    description: "Description of project two.",
    link: "http://example.com/project-two",
    image: "https://i.pinimg.com/originals/8b/35/fe/8b35fef55fba1a201c9c7a11d3ec3d64.gif",
  },
  {
    title: "Project Three",
    description: "Description of project three.",
    link: "http://example.com/project-three",
    image: "https://i.pinimg.com/originals/f5/8f/e8/f58fe8e19a7e25ddf0c459a3599261d6.gif",
  },
  {
    title: "Project Four",
    description: "Description of project four.",
    link: "http://example.com/project-four",
    image: "https://i.pinimg.com/originals/b1/5b/d5/b15bd596014d9d9310e59b07b85da550.gif",
  },
  {
    title: "Project Five",
    description: "Description of project five.",
    link: "http://example.com/project-five",
    image: "https://i.pinimg.com/originals/f9/57/6f/f9576fca9fc8ef79976a1d6327bbe9ae.gif",
  },
];

const Projects = () => {
  return (
    <div className="projects-container">
      <h6>Projects</h6>
      <div className="projects-grid">
        {projectsData.map((project, index) => (
          <div 
            className="project-box" 
            key={index} 
            style={{ backgroundImage: `url(${project.image})` }} // Set GIF background
          >
            <h3>{project.title}</h3>
            <p>{project.description}</p>
            <a href={project.link} target="_blank" rel="noopener noreferrer">View Project</a>
          </div>
        ))}
      </div>
    </div>
  );
};

export default Projects;
